description:
[[About]]
---------
Took me a while to track this down, so here it is! This is rare, so enjoy it. Please comment and HELP SEED when done.

The ukulele version of 'while my guitar gently weeps' by George Harrison (The Beatles) - as performed by Jake Shimabukuro. 

Transcribed by 'Ukukele Dom' but removed from his site a while ago by request of Jake.


